import React from 'react';
import Calendar from 'react-calendar';
import './App.css';
//import 'react-calendar/dist/Calendar.css';

class Event {
  constructor(name, date, time, location) {
    this.name = name;
    this.date = date;
    this.time = time;
    this.location = location;
  }
}

function App() {
  return (
    <div>
      <Calendar />
    </div>
  );
}

export default App;
